import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import Fab from '@mui/material/Fab';
import AddIcon from '@mui/icons-material/Add';
import FormDialog from '../form_dialog/FormDialog';
import Search from '../search/Search';
import { Paper } from '@mui/material';

const Notes = () => {
  const [openDialog, setOpenDialog] = useState(false);

  const handleOpenDialog = () => {
    setOpenDialog(true);
  };

  const handleCloseDialog = () => {
    setOpenDialog(false);
  };
  const paperstyle = { width: "32vw",height:"10vh" };
  return (
    <>
      <div style={{ display: "flex", justifyContent: "space-between" }}>
        <h1>Notes</h1>
        <Fab color="primary" aria-label="add" onClick={handleOpenDialog}>
          <AddIcon />
        </Fab>
      </div>
      <Search />
      <Paper elevation={10} style={{ ...paperstyle }}>
      </Paper>
      {/* Render the FormDialog component */}
      <FormDialog open={openDialog} handleClose={handleCloseDialog} />
    </>
  );
};

export default Notes;
